(637, 3, 0, '2016-06-14 00:00:00', '0', -1, 'Jan kam eine halbe Stunde nach dem kuscheln runter und klagte &uuml;ber Kopfschmerzen oben und an der Seite. Beim Kuscheln hatte er auf Nachfrage noch keine Kopfschmerzen. Er hat dann etwas getrunken und danach war es gut. ', 0, '2016-06-15 03:40:47'),
(638, 3, 0, '2016-06-13 00:00:00', '0', -1, 'Jan kam nach dem Kuscheln noch mal runter und klagte &uuml;ber Kopfschmerzen. Wir haben ihn  mit einem K&uuml;hlkissen wieder nach oben geschickt. ', 0, '2016-06-15 03:42:50'),
(639, 2, 0, '2016-06-19 00:00:00', '1', 1, 'Eigentlich haupts&auml;chlich Nackenschmerzen und total verspannte Nacken-/Schultermuskulatur.', 0, '2016-06-19 16:34:02'),
